package payment

import (
	"context"
	"testing"
)

func TestAppleParseNotify(t *testing.T) {
	tokenStr := `{"signedPayload":"..md40YWF72nKOfImJcRZ3Sw9zkyy_0CDCnUx6pgbgugD3870KMDjdcTsM--SNDwDvsBBNNbdeph6tJvMsXB3mXQ"}`
	ap, _ := NewApplePay()
	res, err := ap.ParseNotify(context.Background(), []byte(tokenStr))
	if err != nil {
		t.Fatal(err)
	}
	t.Log(res)
}
